import React from 'react';

const Footer = () => {
  return (
    <footer style={{ background: '#222', color: '#fff', padding: '50px 0', textAlign: 'center' }}>
      <div className="container">
        <h3 style={{ marginBottom: '10px' }}>Techverge Solutions</h3>
        <p style={{ opacity: 0.6, marginBottom: '30px' }}>Smart Digital Solutions for Your Business</p>
        <p style={{ fontSize: '0.8rem', opacity: 0.4 }}>&copy; 2026 Techverge Solutions. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
